description:
The debut EP from Lancaster Pennsylvania&#8217;s <span class="caps">CAPTAIN OF COMPLIMENTS</span>.

	Here is what people are saying,

	&#8220;One thing is certain: CoC are definitely a band to look out for, especially considering there is a severe lack of music like this being made today.&#8221; 
-Punknews.org

	&#8220;Not afraid to throw genres out the window, these guys are truly something. It&#8217;s tough to describe the type of music they play, because I find it to be unlike most other bands I&#8217;ve heard. The vocals wonderfully anchor their music and are the first thing that grabbed my attention, simply for the fact that they don&#8217;t fit into the typical hardcore band sound.&#8221; 
-Absolute Punk

	&#8220;They play with the confidence of a seasoned unit&#8230; They have a bright future ahead of them.&#8221; 
-Shinbone
